column8:
メーカー希望小売価格はメーカーサイトに基づいて掲載しています<br>

<img src="http://image.rakuten.co.jp/goodgoodsy/cabinet/02292946/151109-kit.jpg">
<div style="font-size:12px;padding:5px 4px;line-height:180%;text-align:left;margin-bottom:10px;">

高輝度米国CREE社製COBチップを搭載し、超爆光を実現！<br>
引掛けタイプで、足場パイプ（単管パイプ）などに引っ掛けて使用できます。<br>
スタンドの四箇所に超強力マグネット付！様々なシーンで活躍すること間違いなし!
<br>
２段階調光機能！HIGH/LOW切替スイッチ式<br>
優れた防水機能により、雨に当たる屋外にもご使用いただけます。<br><br>
【製品仕様】<br>
商 品 名：バッテリー着脱式LED投光器<br>
JANコード：4571461861227<br>
品番：GH40-L（GOODGOODS正規品）<br>
重さ：約2.9KG<br>
材 質：アルミ<br>
電 圧：DC12V-24V/AC100-240V<br>
LED Power：40W<br>
照射角度：約120°<br>
全光束（明るさ）：5600LM<br>
角度調整：上下：180度<br>
光源：昼白色<br>
バッテリー容量：8800mAh（2パック<br>）
充電時間：約3～4時間（1パック）<br>
防水クラス：IP65（生活防水）<br>
点灯時間：LOW：4時間、HIGH：2時間（電池バック1個）<br>
LOW：8時間、HIGH：4時間（電池バック2個） <br>
色 温 度：6000～6500K<br>
点灯モード：2モード（ハイ・ロー）<br>
サ イ ズ：約230mm*215mm*355mm<br>
セット内容：本体 * 1、ACアダプター * 1、シガーソケット * 1、電池パック * 2 <br>
用途：災害時への備え、キャンプ、アウトドア、夜間、乗用車やトラックでの積み卸し、現場工事、駐車場、集魚灯、作業灯にも様々な場所で活躍します！<br>
農業機械、建設機械、船舶、トラック荷台等の作業時の備えに、交通整理に、事故救援に、工事現場に、 倉庫照明にさまざまな場面で活躍できます！ 
</div>


